 const styles = theme => ({
    statisticCard: {
         marginTop: theme.spacing(3),
         padding: theme.spacing(2),
         width: "50vw",
    },
    chart: {
       marginTop: theme.spacing(1),
       height: theme.spacing(5),
    }
 })

 export default styles;
